import posts from '../posts.json'

export default () => (
	<div>
		<h1>Blog</h1>
		<ul>
			{
				Object.entries(posts).map((value, index) => (
					<li key={index}>
						{JSON.stringify(value)}
					</li>
				))
			}
		</ul>
	</div>
)

